import os
import json
import pytest
from unittest.mock import patch, mock_open
from agents.tools.tool_image_llm_parser import parse_clinical_document
import base64

# Sample test data
SAMPLE_IMAGE_PATH = "test_image.png"
# A valid base64-encoded 1x1 pixel PNG image
SAMPLE_BASE64_IMAGE = ""
SAMPLE_JSON_RESPONSE = {
     "MEMBER NAME": "John Doe",
     "Date of Birth": "1/1/2010",
     "ID": "twytwu1818"
}

@pytest.fixture
def mock_openai_response():
    """Mock OpenAI API response."""
    class MockMessage:
        def __init__(self, content):
            self.content = content

    class MockChoice:
        def __init__(self, message):
            self.message = message

    class MockResponse:
        def __init__(self, content):
            self.choices = [MockChoice(MockMessage(content))]

    return MockResponse(json.dumps(SAMPLE_JSON_RESPONSE))

def test_parse_clinical_document_success(mock_openai_response):
    """Test successful parsing of a clinical document."""
    # Create a mock file with valid image data
    mock_file = mock_open(read_data=base64.b64decode(SAMPLE_BASE64_IMAGE))
    
    with patch("builtins.open", mock_file), \
         patch("base64.b64encode", return_value=SAMPLE_BASE64_IMAGE.encode()), \
         patch("openai.OpenAI") as mock_client:
        
        # Configure the mock client
        mock_client.return_value.chat.completions.create.return_value = mock_openai_response
        
        # Call the function
        result = parse_clinical_document(SAMPLE_IMAGE_PATH)
        print(f"result - {result}")
        # Verify the result
        assert result == SAMPLE_JSON_RESPONSE
